import logo from './logo.svg';
import './App.css';
import './styles.css'

function App() {
  return (
    <div className="App">
      <header className="header">
        <h1>Welcome to MovieStack</h1>
      </header>
      <footer className='footer'>
        <p className='footer'>Footer content</p>
      </footer>
    </div>
  );
}

export default App;
